import './App.css';
import Nav from './nav';
import Homepage from './homepage';
import Cart from './cart';
import Shop from './shop';


function App() {
  return (
    <div className="App">
      <Nav/>
      <Homepage/>
      <Shop/>
      <Cart/>
    </div>
  );
}

export default App;
